
#VARIABLE START
#debug instructions = ' '
instructions = '''
 
 
 
 
 
'''
keypad = [
['X', 'X', 'X', 'X', 'X', 'X', 'X'],
['X', 'X', 'X', '1', 'X', 'X', 'X'],
['X', 'X', '2', '3', '4', 'X', 'X'], 
['X', '5', '6', '7', '8', '9', 'X'], 
['X', 'X', 'A', 'B', 'C', 'X', 'X'],
['X', 'X', 'X', 'D', 'X', 'X', 'X'], 
['X', 'X', 'X', 'X', 'X', 'X', 'X']]
yaxis = 3
xaxis = 1
position = keypad[yaxis][xaxis] # starting position
#VARIABLE END

#FUNCTION START
for instruction in instructions:

	if instruction == 'U':					#UP
		yaxis -= 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			yaxis += 1
		
	if instruction == 'D':					#DOWN
		yaxis += 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			yaxis -= 1
		
	if instruction == 'L':					#LEFT
		xaxis -= 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			xaxis += 1

	if instruction == 'R': 					#RIGHT
		xaxis += 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			xaxis -= 1
		
	if instruction == ' ':					#Space, print
		position = keypad[yaxis][xaxis]
		print(position)
#FUNCTION END
